import React, { Component } from 'react';
import { BrowserRouter, Router, Route ,Link } from "react-router-dom";
import sginUpForm from "./pages/sginUpForm";
import sginInForm from "./pages/sginInForm"
import './App.css';

class App extends Component {
  render(){
    return (
      <BrowserRouter>
        <div className="App">
        <div className="App__Aside">
          Hi 
          My name is Ali Yaghoobian
        </div>

        <div className="App__Form">
          <div className="PageSwitcher">
            <a href="#" className="PageSwitcher__Item ">Sign In</a>
            <a href="#" className="PageSwitcher__Item PageSwitcher__Item--Active">Sgin Up</a>
          </div>

          <div className="FormTitle">
            <Link to ="/sgin-in" className="FormTitle__Link">Sgin In</Link> or <Link to ="/sgin-up" 
            className="FormTitle__Link FormTitle__Link--Active">Sgin Up</Link>
          </div>
           <Route exact path="/sgin-up" component={sginUpForm}> 

          </Route>

          <Route path="/sgin-in" component={sginInForm}>
            <h1>Sgin in hi</h1>
          </Route>
          </div>

        </div>
      </BrowserRouter>
    );
  }

}

export default App;
